import Information from './Information';
function Artist (){
    const info = [
         {id:1,img:'/images/1.png',name:'String Puppet',detail:'Character controled by a hand'},
         {id:2,img:'/images/2.png',name:'pill',detail:'Medicine in the hands of a man'},
         {id:3,img:'/images/3.png',name:'One more',detail:'Man signaling for one more drink'},
         {id:4,img:'/images/4.png',name:'Alien'},
         {id:5,img:'/images/5.png',name:'Pirate',detail:'Pirate with parrot on shoulder'}]
    const members=info.map(function(member){
        return <Information
        key={member.id}
         img={member.img}
         name={member.name}
         detail={member.detail}



        />

    })
        return(
            <div className='row'>
                {members}
            </div>
        )
    }

export default Artist;
